egion --><!-- /ko --><!-- ko text: address().city --><!-- /ko --><!-- ko if: ( address().customAttributes && address().customAttributes.district && address().customAttributes.district.value)--><!-- ko text: address().customAttributes.district.value --><!-- /ko --><!-- /ko --><!-- ko text: _.values(address().street).join(\", \") --><!-- /ko -->\n        </span>\n    </div>\n    <div class=\"adress_phone\">\n        <!-- ko if: (address().telephone) -->\n        <a data-bind=\"text: address().telephone, attr: {'href': 'tel:' + address().telephone}\"></a>\n        <!-- /ko -->\n    </div>\n    <!-- ko if: false -->\n    <!-- ko foreach: { data: address().customAttributes, as: 'element' } -->\n    <!-- ko foreach: { data: Object.keys(element), as: 'attribute' } -->\n    <!-- ko if: (typeof element[attribute] === \"object\") -->\n    <!-- ko text: element[attribute].value -->\n    <!-- /ko -->\n    <!-- /ko -->\n    <!-- ko if: (typeof element[attribute] === \"string\") -->\n    <!-- ko text: element[attribute] -->\n    <!-- /ko -->\n    <!-- /ko --><br />\n    <!-- /ko -->\n    <!-- /ko -->\n    <!-- /ko -->\n    <div class=\"top_btn\">\n        <!-- ko if: (!address().isDefaultShipping()) -->\n        <button type=\"button\" class=\"default_btn\" data-bind=\"i18n: 'Default', click: setDefaultShipping, clickBubble: false\">\n        </button>\n        <!-- /ko -->\n        <!-- ko if: (address().isEditable()) -->\n        <button type=\"button\" class=\"action edit-address-link\" data-bind=\"click: editAddress,clickBubble: false,visible: address().isEditable()\">\n            <span data-bind=\"i18n: 'Edit'\"></span>\n        </button>\n        <!-- /ko -->\n    </div>\n    <!-- ko if: (address().isDefaultShipping()) -->\n    <div class=\"default_tag\" data-bind=\"i18n: 'Default'\">\n    </div>\n    <!-- /ko -->\n</div>\n","IsobarCommerce_Localization/template/billing-address/details.html":"<div class=\"billing-address-details\" data-bind=\"if: isAddressDetailsVisible() 